  \"2013-03-15T12:26:16.230774\",\n\t\"name\": \"digital-geologic-map-of-great-basin-national-park-and-vicinity-nevada-nps-grd-gre-grba\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Digital Geologic Map of Great Basin
  National Park and Vicinity, Nevada is composed of GIS data layers, two ancillary
  GIS tables, a Windows Help File with ancillary map text, figures and tables, GIS
  data layer and table FGDC metadata and ArcMap 9.1 layer (.LYR) files. The data were
  completed as a component of the Geologic Resource Evaluation (GRE) program, a National
  Park Service (NPS) Inventory and Monitoring (I&M) funded program that is administered
  by the NPS Geologic Resources Division (GRD). All GIS and ancillary tables were
  produced as per the NPS GRE Geology-GIS Geodatabase Data Model v. 1.4. (available
  at: http://science.nature.nps.gov/im/inventory/geology/GeologyGISDataModel.cfm).
  The GIS data is available as a 9.1 personal geodatabase (grba_geology.mdb), as coverage
  and table export (.E00) files, and as a shapefile (.SHP) and DBASEIV (.DBF) table
  files. The GIS data projection is NAD83, UTM Zone 11N. That data is within the area
  of interest of Great Basin National Park.\",\n\t\"license_title\": null,\n\t\"extras\":
